import React from 'react';
import logo from './logo.svg';
import './App.css';
import MarkdownViewer from './MarkdownViewer'

function App() {
  let content = `
# Prove that a union of any two countably infinite sets is countably infinite.

countably infinite한 두 집합을 $A$, $B$라고 하자. 이제 아래 과정을 따라 명제를 증명한다.

1. $A \cap B = \varnothing$일 때, 집합 $A$와 $B$가 countably infinite하기 때문에 두개의 전단사 함수 $f:A\rightarrow N$와 $g: B \rightarrow N$가 존재한다. 이 때 함수 $h: A\cup B \rightarrow N$를 아래와 같이 정의하자.
`;

  return (
    <MarkdownViewer source={content}/>
  );
}

export default App;
